            <div
              className="flex items-center justify-center  flex-col  transition ease-in-out delay-150  "
              // data-aos="fade-up"
              // data-aos-duration="3000"
            >
              <img
                //   src={`http://192.168.29.3:8001/${items.url}`}
                alt="Bonnie image"
              />
            </div>
          </div>
          {/* ))} */}
        </div>
      </div>
    </>
  );
}

export default AllColction;
